description:
Collection of songs by the California-based music collective Cricket Engine. This free release of songs is just a few of many made, including 2 self-released albums. Often written in cabins between hikes or time away from classes.

The songs will appeal most to fans of Glo-fi, Ratatat, Sigur Ros, WARP Records, &amp; Caribou and is FREE for public distribuition. Creative Commons rights apply!

Download the album fromHERE:


Members: Scott Schou, Seth Pereira, Cody Dingle, Ian Hill and Sean Patrick Maylone

